script: |
  super -f text -I q8110.spq | sort > q8110.out

inputs:
  - name: q8110.spq
    data: |
      SELECT DISTINCT - col1 + col1 / - ( ( + col0 ) * col2 + ( - col1 ) ) AS col1 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q8110.out
    data: |
      -86
      -91
      -96
